import React from "react";

const Slider = ({ onChange, disabled }) => {
  return (
    <div className="wrapper">
        <h2 className="slider-title">Select Speed</h2>
        <div className="speed-slider" onChange={onChange}>
          <input
            type="radio"
            name="speed"
            id="slow"
            value={500}
            disabled={disabled}
          />
          <label htmlFor="slow" current-speed="Slow">Slow</label>
          <input
            type="radio"
            name="speed"
            id="medium"
            value={50}
            defaultChecked
            disabled={disabled}
          />
          <label htmlFor="medium" current-speed="Medium">Medium</label>
          <input
            type="radio"
            name="speed"
            id="fast"
            value={5}
            disabled={disabled}
          />
          <label htmlFor="fast" current-speed="Fast">Fast</label>
        </div>
    </div>
  );
};

export default Slider;
